El poema "Carta en noviembre" fue escrito por Ángel González, poeta español nacido en Oviedo en 1925 y fallecido en 2008. Pertenece a la llamada Generación del 50 o "Generación de medio siglo", y es uno de los principales representantes de la poesía social de la posguerra española.
